import React from "react";

function Topseaction() {
  const data = [
    {
      name: "Earning",
      amount: "198",
      increment: "37.8% this month",
      class: "green",
    },
    {
      name: "Orders",
      amount: "198",
      increment: "37.8% this month",
      class: "blue",
    },
    {
      name: "Earning",
      amount: "198",
      increment: "37.8% this month",
      class: "aqua",
    },
    {
      name: "Earning",
      amount: "198",
      increment: "37.8% this month",
      class: "pink",
    },
  ];
  return (
    <div className="roundee">
      <div className="round">
        {" "}
        <p className="green">1</p>{" "}
        <p className="small">
          <span>Earning</span>
          <span>$198K</span>
          <span>37.8% this month</span>
        </p>
      </div>
      <div className="round">
        {" "}
        <p className="blue">2</p>{" "}
        <p className="small">
          <span>Orders</span>
          <span>$2.4K</span>
          <span>2% this month</span>
        </p>
      </div>
      <div className="round">
        {" "}
        <p className="aqua">3</p>{" "}
        <p className="small">
          <span>Balence</span>
          <span>$2.4K</span>
          <span>2% this month</span>
        </p>
      </div>
      <div className="round">
        {" "}
        <p className="pink">4</p>{" "}
        <p className="small">
          <span>Total sale</span>
          <span>$89K</span>
          <span>11% this week</span>
        </p>
      </div>
    </div>
  );
}

export default Topseaction;
